                $(""#roadFrame"").attr(""src"", roadmapURL);
                $(""#satFrame"").attr(""src"", satellitemapURL);
                showMap(1);
            }
        });
    }
    function showMap(mapNo)
    {
        if (mapNo == 1) {
            $(""#roadFrame"").show();
            $(""#satFrame"").hide();
        }
        else if (mapNo == 2) {
            $(""#roadFrame"").hide();
            $(""#satFrame"").show();
        }
        else if (mapNo == 3) {
            $(""#roadFrame"").hide();
            $(""#satFrame"").hide();
        }
    }
</script>
